import React from 'react';
import Navbar from './Navber/Navbar'

const Header = () => {
    return (
        <div >
           <Navbar/>
            <div className="header-content">
            <img className="Header-img" src="" alt=""/>
            </div>
        </div>
    );
};

export default Header;
